  \"Narrative report: Klamath Basin National Wildlife Refuges: Tule Lake, Lower Klamath,
  and Clear Lake in California, Upper Klamath and Klamath Forest in Oregon: September
  - December, 1962\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:54:22.524726\",\n\t\"name\": \"narrative-report-klamath-basin-national-wildlife-refuges-tule-lake-lower-klamath-and-clear\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Tule Lake National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1962. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  fish, reptiles, and disease- is also covered. The Refuge development and maintenance
  section discusses plantings, vegetation control, collections and receipts, and wildfires.
  Resource management is outlined; topics include fur harvesting. A progress report
  on field investigations and applied research is included. The public relations section
  of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, and violations. Items of interest, N-R forms, photographs, and narrative
  reports on Clear Lake National Wildlife Refuge, Upper Klamath National Wildlife
  Refuge, and Lower Klamath National Wildlife Refuge are attached.\",\n\t\"license_title\":
